// components/OvalBar.js
import React from 'react';
import './OvalBar.css';

function OvalBar() {
  return (
    <div className="oval-bar">
      <div className="oval-icon">
        <i className="fas fa-seedling"></i> {/* Icon 1 */}
      </div>
      <div className="vertical-line"></div>
      <div className="oval-icon">
        <i className="fas fa-tractor"></i> {/* Icon 2 */}
      </div>
      <div className="vertical-line"></div>
      <div className="oval-icon">
        <i className="fas fa-leaf"></i> {/* Icon 3 */}
      </div>
    </div>
  );
}

export default OvalBar;
